CREATE  FUNCTION `consultarJurados` (`id` INT) RETURNS INT(11) BEGIN
    DECLARE idTutor int;

  select tutor into idTutor from proyecto where idProyecto = id;

  if idTutor is null then 
  set idTutor = 0;
  end if;

  return idTutor;
END$$

CREATE  FUNCTION `consultarTutores` (`id` INT) RETURNS INT(11) BEGIN
    DECLARE idJurado int;

  select jurado into idJurado from proyecto where idProyecto = id;

  if idJurado is null then 
  set idJurado = 0;
  end if;

  return idJurado;
END$$

CREATE  FUNCTION `jurado` (`id` INT) RETURNS TEXT CHARSET utf8 begin
declare jurado text;
select nombre into jurado from profesor p inner join proyecto pr on p.idprofesor = pr.jurado and pr.idproyecto = id;
return jurado;

end$$

CREATE  FUNCTION `tutor` (`id` INT) RETURNS TEXT CHARSET utf8 begin
declare tutor text;
select nombre into tutor from profesor p inner join proyecto pr on p.idprofesor = pr.tutor and pr.idproyecto = id;
return tutor;

end$$

CREATE  FUNCTION `verificarJurado` (`id` INT) RETURNS INT(11) BEGIN

    DECLARE idJurado int;

    select jurado into idJurado from proyecto where idproyecto = id;

    if idJurado is null then 
    set idJurado = 0;
    end if;

    return idJurado;

end$$

CREATE  FUNCTION `verificarTutor` (`id` INT) RETURNS INT(11) BEGIN

    DECLARE idTutor int;

    select tutor into idTutor from proyecto where idproyecto = id;

    if idTutor is null then 
