 la ciudad de Bogotá hay una gran cantidad de satélites de\r\nconfección, cuya forma de empleo es informal, ya que no hay ningún tipo de\r\ncontrato formalizado entre el trabajador y el empleador. Estas microempresas\r\nestán conformadas entre 5 a 10 empleados, en donde su trabajo dependiendo de la\r\nempresa es realizar determinadas tareas para la elaboración de una prenda de\r\nvestir u otro tipo de tejido.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;line-height:200%\"><span style=\"font-size:12.0pt;line-height:200%;font-family:&quot;Times New Roman&quot;,serif\">Como\r\nejemplo, el taller familiar de la señora Blanca ubicado en el barrio Villas del\r\nBolívar localidad de Ciudad Bolívar, cuenta con una serie de máquinas para la\r\nconfección de prendas de vestir. Él circulo de trabajo está compuesto por 6\r\noperarios en donde la mayoría pertenecen a una misma familia; cada operario\r\nestá especializado en determinada máquina con el fin de agilizar la elaboración\r\nde la prenda.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;line-height:200%\"><span style=\"font-size:12.0pt;line-height:200%;font-family:&quot;Times New Roman&quot;,serif\">Actualmente\r\ndiferentes satélites de confección utilizan el método de pagar al destajo, el\r\ncual consiste en realizar el pago hacia los operarios por medio de las tareas\r\nrealizadas por este mismo, estas tareas son operaciones que lleva la prenda a\r\nconfeccionar, cada operación tiene un valor establecido, por lo tanto, para\r\nobtener el pago del operario sobre esta tarea se toma la cantidad de iteraciones\r\nde la operación y se multiplica por el valor de la operación. Luego se realiza\r\nel mismo proceso con las demás tareas y van sumandos estos productos para tener\r\nel saldo total, este proceso suele hacer en cuadernos y calculadora por no\r\ntener un sistema que sistematice estos datos.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;line-height:200%\"><span style=\"font-size:12.0pt;line-height:200%;font-family:&quot;Times New Roman&quot;,serif\">Las\r\nconsecuencias de hacer este proceso de forma como se describió anteriormente es\r\nque toma mucho tiempo para obtener la nómina de los operarios y puede generar\r\nestrés en algunos casos ya que puede haber confusión en registro de las tareas,\r\npor ejemplo, anotar una misma tarea a dos operarios con misma cantidad de\r\niteraciones, no anotar tareas a un operario generando pérdidas para esté, hacer\r\nel cálculo mal, etc. Otro problema que se puede observar es en la parte\r\ncontable ya que no se hace de forma organizada y no se tiene un control sobre\r\nel inventario.</span></p>\r\n\r\n', '<p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>ES-CO</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning